import React from "react";
import "./Navbar.css"

function Navbar() {

  return (
    <div id="myMenu" className={"navbar-menu"}>
      <span data-menuanchor="firstPage" className="active"><a data-menuanchor="firstPage" href="#firstPage">First section</a></span>
      <span data-menuanchor="secondPage"><a href="#secondPage">Second section</a></span>
      <span data-menuanchor="thirdPage"><a href="#thirdPage">Third section</a></span>
    </div>
    )
}

export default Navbar;
